export class TagTab {
    render() {
        return h("slot", null);
    }
    static get is() { return "tag-tab"; }
    static get encapsulation() { return "shadow"; }
    static get properties() { return {
        "caption": {
            "type": String,
            "attr": "caption"
        },
        "hidden": {
            "type": Boolean,
            "attr": "hidden"
        },
        "key": {
            "type": String,
            "attr": "key"
        }
    }; }
}
